import "./Navbar.css";
import profilepic from "./profile.jpg";

export function NavbarAdmin () {
  return (
    <div className="navbar">
        <div className="heading">
            <p>Game Theory</p>
        </div>
        <div className="navigation">

            <div className="profile">
                <img src={profilepic}/>
                <p>Username</p>
                <p>(Admin)</p>
            </div>  


            <ul>
                <li><a href="">Create bookings</a></li>
                <li><a href="">View bookings</a></li>
            </ul>
        </div>
       
    </div>
  );
};

export default function NavbarUser () {
    return (
      <div className="navbar">
          <div className="heading">
              <p>Game Theory</p>
          </div>
          <div className="navigation">
  
              <div className="profile">
                  <img src={profilepic}/>
                  <p>Username</p>
                  <p>(User)</p>
              </div>  
  
  
              <ul>
                  <li><a href="">View courts</a></li>
                  <li><a href="">Book slots</a></li>
              </ul>
          </div>
         
      </div>
    );
  };
